import { baseURL } from "./OpenAI";
import { useEffect } from "react";
import axios from "axios";

class GetPetNames extends React.Component {
    constructor(specie) {
        const state = {
            petNames: [],
            specie: specie,
        };
        useEffect(() => {
            axios
                .post(baseURL + "nlp-pet-name/specie/" + specie)
                .then(res => {
                    this.state.petNames = res.data;
                    this.specie = specie;
                })
                .catch(err => {
                    console.log(err);
                });
        }, []);
    }
}

export {GetPetNames}
